              borderRadius: "5px",
              color: "white",
              textAlign: "center",
              outline: "none",
              textDecoration: "none",
              marginTop: "40px",
            }}
            onClick={() => {}}
          >
            Launch Eden
          </div>
        </>
      )}
    </div>
  );
};

export default LaunchScreen;
